import  React,{Fragment} from "react";
import { Head } from "next/head";
import { LazyLoadImage } from 'react-lazy-load-image-component';


const Photography = (props) => {
  return (
    <>
    <div className="photography">
      <div className="row">
        <div className="col">
          <h1>Photography</h1>
          <blockquote>
            <p>An Art that freeze the time forever </p>
          </blockquote>
        </div>
        <div className="col">
          <p className="info">
            Photography is the tool that allows me to view the world with very
            different angle. Before start doing photography I see a things and
            don't care about that beauty, color, shape, etc.
          </p>
          <p className="info">
            I always belive that, a single photo can change entire world from
            nuclear disaster field to garden. I occasionally upload the photo on
            the my <a href="https://www.instagram.com/naveenda_">Instagram account.</a> I always want to become a street
            photographer, but I never take a good street photo till date.
          </p>
        </div>
      </div>
    </div>
    </>
  );
};
export default Photography;
